import React from "react";
import { Typography, Box, Container } from "@mui/material";

function Home() {
  return (
    <Box
      sx={{
        height: "100vh", // Set the height to 100% of the viewport height
        overflowY: "auto", // Enable vertical scrolling when needed
      }}
    >
      <Container sx={{ maxWidth: "xl", padding: "0" }}>
        <Box
          sx={{
            marginTop: "50px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            flexDirection: "column", // Align content vertically
          }}
        >
          <Typography
            variant="h1"
            sx={{
              fontFamily: "Rubik",
              fontSize: "6rem",
              color: "lightblack",
              marginBottom: "20px", // Add margin below the heading
            }}
          >
            Welcome To SuperSonics
          </Typography>
        </Box>
      </Container>
    </Box>
  );
}

export default Home;
